export const actionTypes = {
    GET_ALL_STATE_REQUEST: 'GET_ALL_STATE_REQUEST',
    GET_ALL_STATE_SUCCESS: 'GET_ALL_STATE_SUCCESS',
    GET_INACTIVE_STATE_REQUEST: 'GET_INACTIVE_STATE_REQUEST',
    GET_INACTIVE_STATE_SUCCESS: 'GET_INACTIVE_STATE_SUCCESS'
};

export function getAllState(payload) {
    return { type: actionTypes.GET_ALL_STATE_REQUEST, payload };
}

export function getAllStateSuccess(payload) {
    return { type: actionTypes.GET_ALL_STATE_SUCCESS, payload };
}

export function getInactiveState(payload) {
    return { type: actionTypes.GET_INACTIVE_STATE_REQUEST, payload };
}

export function getInactiveStateSuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_STATE_SUCCESS, payload };
}
